import React from 'react';
import Inicio from './Plantilla';
import './../App.css';
import axios from 'axios';
import { useState, useEffect } from 'react';

export default function Tienda() {
  const [data, setData] = useState([]);
  const [valor1, setValor1] = ("");
  const Buscar = (e) => {
    useEffect(() => {
      // Realizar la petición GET cuando el componente se monte
      axios.post('http://localhost:8080/api/usuarios')
        .then(response => {
          setData(response.data);
          setValor1(e.target.value)
        })
        console
        .catch(error => {
          console.error('Error al obtener los datos:', error);
        });
    }, []);
  }
  return (
    <Inicio>
      <div className="container">
        <input value='' className='buscador' onChange={Buscar} placeholder='productos'/>
        <div className="cajas">
          <div className='caja'>{valor1}</div>
          <div className='caja'>Div 2</div>
          <div className='caja'>Div 3</div>
        </div>
        <div className="cajas">
          <div className='caja'>Div 4</div>
          <div className='caja'>Div 5</div>
          <div className='caja'>Div 6</div>
        </div>
      </div>
    </Inicio>
  )
}
